import { Tooltip } from "primereact/tooltip";

function getGovObj(data, gov, avg) {
  var govData = data.find((e) => e.TYPE === "Terminal Governorate" && e.KEY === gov);

  var highestNumOfTerminalsInGovColor = "#113F51";
  var averageNumOfTerminalsInGovColor = "#3199C1";
  var lowestNumOfTerminalsInGovColor = "#4EB6DE";
  var noTerminalsInGovColor = "#6AD2FB";

  return {
    numOfTerminals: govData?.VALUE,
    fillColor:
      govData?.VALUE >= avg * 2
        ? highestNumOfTerminalsInGovColor
        : govData?.VALUE >= avg
        ? averageNumOfTerminalsInGovColor
        : !govData?.VALUE
        ? noTerminalsInGovColor
        : lowestNumOfTerminalsInGovColor,
  };
}

